CREATE TABLE schoolcheck(
   id      INT  NOT NULL PRIMARY KEY 
  ,schoolname VARCHAR(255)
  ,adress  VARCHAR(255)
  ,zipcode VARCHAR(255)
  ,district VARCHAR(255)
  ,telnr   VARCHAR(255)
  ,email   VARCHAR(255)
  ,website VARCHAR(255)
  ,opendays VARCHAR(255)
  ,openclass VARCHAR(255)
  ,infonight VARCHAR(255)
  ,private VARCHAR(255)
  ,level   VARCHAR(255)
  ,concept VARCHAR(255)
  ,specials VARCHAR(255)
  ,tto     VARCHAR(255)
  ,sports  VARCHAR(255)
  ,tech    VARCHAR(255)
  ,spanish VARCHAR(255)
  ,vso     VARCHAR(255)
  ,vmboB   VARCHAR(255)
  ,vmboK   VARCHAR(255)
  ,vmboT   VARCHAR(255)
  ,havo    VARCHAR(255)
  ,vwo     VARCHAR(255)
  ,gymnasium VARCHAR(255)
  ,basis   VARCHAR(255)
  ,art     VARCHAR(255)
);
